import React from "react";
import './nav.css';

const NavBar = () => {
  return (
    <div className="container  border-bottom border-black">
      <h2 className="navbar-h2">BUSCA HOSTELES</h2>
      <input
        placeholder="Search"
        className="form-control-lg search"
      />
    </div>
  );
};

export default NavBar;
